void history_start(HistoryItem item) {
...
if (history_empty())
{
item.on_create(item.self);
item.on_resume(item.self);
history_push(item);
return;
} ...
}

void history_back() {
...
top = history_pop();
top.on_pause(top.self);
top.on_destroy(top.self);
if (history_empty()) {
return;
} ...
}
